<!DOCTYPE HTML PUBLIC "-//W3C//DTD HTML 4.01 Transitional//EN">
<script>

function hand_phone()
{

//document.regform.phone.focus();

var tel=tr_phone(regform.phone.value);



var l=tel.length;
var mess="Проверьте правильность номера Вашего телефона";



if(l==11){

	if(tel.match(/^89\d+/)){
	var tel_n=tel.replace(/^89/,"+79");




	var fnd=/^\+7(\d{3})(\d{3})(\d{2})(\d{2})/.exec(tel_n);
	var phone_w="+7 "+fnd[1]+" "+fnd[2]+" "+fnd[3]+" "+fnd[4];

	var res=prompt(mess+":  ",phone_w);
	if(res){

	res=res.replace(/ /g,"");
	document.regform.phone.value=res;
	return;
	}
	else{
	document.regform.phone.value=tel_n;
	       return;
	}

	}


        if(tel.match(/^810\d+/)){

	var tel_n=tel.replace(/^810/,"+7");

        alert(tel_n);


	var fnd=/^\+7(\d{4})(\d{2})(\d{2})/.exec(tel_n);
	var phone_w="+7 "+fnd[1]+" "+fnd[2]+" "+fnd[3];

	var res=prompt(mess+":  ",phone_w);
	if(res){

	res=res.replace(/ /g,"");
	document.regform.phone.value=res;
	return;
	}
	else{
	document.regform.phone.value=tel_n;
	       return;
	}


	}

if(tel.match(/^8\d+/)){
	var tel_n=tel.replace(/^8/,"+7");




	var fnd=/^\+7(\d{4})(\d{2})(\d{2})(\d{2})/.exec(tel_n);
	var phone_w="+7 "+fnd[1]+" "+fnd[2]+" "+fnd[3]+" "+fnd[4];

	var res=prompt(mess+":  ",phone_w);
	if(res){

	res=res.replace(/ /g,"");
	document.regform.phone.value=res;
	return;
	}
	else{
	document.regform.phone.value=tel_n;
	       return;
	}

	}



}
else{


var fnd=/^(\d+)(\d{4})(\d{3})(\d{2})(\d{2})/.exec(tel);

	var phone_w=fnd[1]+" "+fnd[2]+" "+fnd[3]+" "+fnd[4]+" "+fnd[5];

	var res=prompt(mess+":  ",phone_w);
	if(res){

	res=res.replace(/ /g,"");
	document.regform.phone.value=res;
	return;
	}
	else{
	document.regform.phone.value=tel;
	       return;
	}





}




}


function tr_phone(s)
{

return s.replace(/[^0-9+]/g,"");

}

</script>
